import React from 'react';

import '../style/background.css';
import '../style/homePageDesign.css';

import Background from '../components/backgrounds/Background';


const HomePageDesign = () => (
    <>
        <div class = "title1-m">Hello, I'm Kelly</div>

        <div class= "heading-m">I’m an engineering student and designer at UC Berkeley. My philosophy is to innovate for impact.</div>

        <div class = "title2-m">What I’m up to</div>

        <div class= "list1-m">Project manager @ Berkeley Innovation  
        Incoming SWE intern @ Uber 
        Electrical Engineering & Computer Science @ UC Berkeley 
        Building this site from scratch</div>

        <Background
            backgroundColor = "white"
            blob1 = "blob1-m"
            blob2 = "blob2-m"
            blob3 = "blob3-m"
            blob4 = "blob4-m"
        /> 
    </>
);

export default HomePageDesign;
